import React from "react";
import "./style.css";

const contact = () => {
  const onSubmit = async (event) => {
    event.preventDefault();
    const formData = new FormData(event.target);

    formData.append("access_key", "YOUR_ACCESS_KEY_HERE");

    const object = Object.fromEntries(formData);
    const json = JSON.stringify(object);

    const res = await fetch("https://api.web3forms.com/submit", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
        Accept: "application/json",
      },
      body: json,
    }).then((res) => res.json());

    if (res.success) {
      console.log("Success", res);
    }
  };

  return (
    <>
      <main className="col-sm-12 col-md-12 col-lg-12 col-xl-12 d-flex justify-content-center p-5">
        <form className="col-sm-12 col-md-10 col-lg-6 col-xl-6">
          <h1 className="mb-4 text-center">Contact Us</h1>
          <div data-mdb-input-init className="form-outline mb-4">
            <label className="form-label" for="form4Example1">
              Name
            </label>
            <input
              type="text"
              id="form4Example1"
              className="form-control"
              placeholder="Enter you name"
            />
          </div>

          <div data-mdb-input-init className="form-outline mb-4">
            <label className="form-label" for="form4Example2">
              Email address
            </label>
            <input
              type="email"
              id="form4Example2"
              className="form-control"
              placeholder="Enter you email"
            />
          </div>

          <div data-mdb-input-init className="form-outline mb-4">
            <label className="form-label" for="form4Example3">
              Message
            </label>
            <textarea
              className="form-control"
              id="form4Example3"
              rows="4"
              placeholder="Enter you message"
            ></textarea>
          </div>
          <div className="text-center">
            <button
              data-mdb-ripple-init
              type="button"
              className="btn btn-outline-warning mb-4"
            >
              Send
            </button>
          </div>
        </form>
      </main>
    </>
  );
};

export default contact;
